                </a>
                <a href="https://www.youtube.com">
                    <img src={require('../imgs/insta.png')}></img>
                </a>
                <a href="https://www.google.com">
                    <img src={require('../imgs/insta.png')}></img>
                </a>
                <a href="https://www.kali.com">
                    <img src={require('../imgs/insta.png')}></img>
                </a>
                

            </main>
            )
    }
}

export default SocialItem;
